// Function Prototypes
void plot_pixel(int x, int y, short int line_color);

void clear_screen();

void swap(int *a, int *b);
void wait_for_vsync();
void plot_image_menu(int x, int y);

int main(void) {
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;

    /* Set up Buffer 1 as the initial back buffer */
    *(pixel_ctrl_ptr + 1) = (int)&Buffer1;
    
    /* Swap buffers - Buffer 1 is now the front buffer */
    wait_for_vsync();
    
    /* Initialize pixel_buffer_start to the appropriate buffer */
    pixel_buffer_start = *pixel_ctrl_ptr;
    
    /* Clear the current front buffer (Buffer 1) */
    clear_screen();
    
    /* Set up Buffer 2 as the new back buffer */
    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    
    /* pixel_buffer_start now points to Buffer 2 (back buffer) */
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    
    /* Clear the back buffer (Buffer 2) */
    clear_screen();

    // Main animation loop
    while (1) {
        // Swap buffers
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // New back buffer
        
        // Clear the back buffer
        clear_screen();
        
        // Always draw menu in each frame (no toggling)
        plot_image_menu(0, 0);
        
    }
}

// Function to plot the menu image at position (x,y)
void plot_image_menu(int x, int y) {
    for (int i = 0; i < 240; i++) {
        for (int j = 0; j < 320; j++) {
            plot_pixel(x + j, y + i, menu[i * 320 + j]);
        }
    }
}

void erase_image_menu(int x, int y) {
    for (int i = 0; i < 240; i++) {
        for (int j = 0; j < 320; j++) {
            plot_pixel(x + j, y + i, 0);
        }
    }
}

// Draw a test pattern that should be clearly visible

void plot_pixel(int x, int y, short int line_color) {
    // Make sure we're within bounds
    if (x < 0 || x >= 320 || y < 0 || y >= 240)
        return;
        
    volatile short int *one_pixel_address;
    one_pixel_address = (volatile short int *)(pixel_buffer_start + (y << 10) + (x << 1));
    *one_pixel_address = line_color;
}

void clear_screen() {
    for (int x = 0; x < 320; x++) {
        for (int y = 0; y < 240; y++) {
            plot_pixel(x, y, 0x0);
        }
    }
}


void swap(int *a, int *b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

void wait_for_vsync() {
    volatile int *fbuf = (int *)0xFF203020;
    int status;
    *fbuf = 1;
    status = *(fbuf + 3);
    while (status & 1) {
        status = *(fbuf + 3);
    }
}